import React from 'react';
import './about.css';

export default function () {
  const lines = ['so...what\'s an algorithm?',
    'and why would you need one?',
    'and what do they look like?'
  ]
  return (
    <div className='lines'>
      {lines.map((line, i) => {
        // setTimeout(() => {
        console.log('set')
        return <div className='' hidden> <p>{line}</p> </div>
        // }, 1000 * i)
      })}
    </div>
  )
}
